  b.extend(list(zip(a,a))) # Le agregamos la diagonal.
  b.remove((0,0)) # Eliminamos 0,0 ya que es un movimiento sin sentido.
  # Comprueba que las permutaciones generadas no superen el valor de p.
  for i in range(len(b)):
    if b[i][0]+b[i][1]<=p:
      w=list(b[i])
      mov.append(w)
  # Comprobamos que al ejecutar el movimiento en el estado a evaluar siga dando estados válidos.
