  fila=0 # Iniciamos en indice 0, servirá para recorrer la matriz.
  lado=1 # Contiene el lado donde se encuentra el bote, 1 izquierda, 2 derecha (también servirá de indice).
  indice= 2 # Necesario para evaluar en que lado estará el estado, aumenta de a 2.

  # Recorre todos los estados y los agrega en la columna 2 (indice 1) de la matriz.
  for i in Estados:
    matriz[fila,1]=i # Fila irá sumando de a 1, la columna siempre será en el indice 1.
    fila+=1

  # Ciclo para organizar los estados.
  while indice <=len(Estados)-1: # Ejecute hasta que indice alcance el tamaño de la lista estados.
    if matriz[indice,lado]== Imagen(matriz[indice-1,lado]): # Si el elemento es igual a la imagen del de arriba suyo entonces cambia de lado.
      # Con un for cambiamos de lado todos los elementos.
      for i in range(indice,len(Estados)):
        if lado == 1: # Si estaba en la izquierda pasamos para la derecha.
          matriz[i,lado+1]=matriz[i,lado] # Sumamos uno a la columna para ir de izquierda a derecha.
          matriz[i,lado]=0.0 # Las casillas que desocupamos las colocamos en 0, (El hecho de que sea float nos servirá para pasarla a DataFrame).
        else: # Si estaba en la derecha pasamos para la izquierda.
          matriz[i,lado-1]=matriz[i,lado] # Restamos 1 a la columna para ir de derecha a izquierda.
          matriz[i,lado]=0.0
      # Anotamos el cambio de lado.
      if lado == 1:
        lado = 2 # Si estaba en izquierda pasa a derecha y viceversa.
      else:
        lado = 1
    # Incrementamos el indice, recordar que es de a 2 ya que solo se cambia de lado cada dos elementos como mínimo.
    indice+=2
  # Colocamos el dato de la fila en 1 para reciclar la variable y evitar crear otra.
  fila = 1
  # Agregamos los movimientos a la matriz.
  for i in recorrido:
    matriz[fila,0] = i
    fila+=2 # Nuevamente se tiene un incremento de dos ya que se hace un movimiento cada dos estados.

  tabla = pd.DataFrame(matriz, columns=["Movimiento","Izquierda","Derecha"]).astype(str) # Volvemos la matriz un DataFrame de Pandas.
