import itertools as it

def estado_valido(estado,prohibido): # Función que calcula si un estado es valido.
  if (estado[0] >= estado[1] or estado[0]==0) and (m-estado[0]>=c-estado[1] or m-estado[0]==0) and estado[0] >=0 and estado[1]>=0 and estado not in prohibido and estado[0] <= m and estado[1] <=c:
  # Estado valido tanto en la izquierda como derecha, que los valores estén entre 0 y m|c y que no se encuentre en los estados ya usados.
    return True
  else:
    return False

def movimientos(estado,p,prohibido): # Calcula todos los movimientos posibles.
  mov_validos=[] # Almacena los movimientos despues del filtro.
  # Genera todos los movimientos posibles.
  todos_movimientos = (list(it.permutations((i for i in range(p+1)),2)))
  todos_movimientos.extend(list(zip((i for i in range(1,p)),(i for i in range(1,p)))))
  # Filtra cuales generan estados validos, ademas de verificar que la canoa lo soporte.
  for i in todos_movimientos:
    if estado[2]==1: # Si va de izquierda a derecha resta.
      if estado_valido([estado[0]-i[0],estado[1]-i[1],0],prohibido) and i[0]+i[1]<=p:
        temp=list(i)
        temp.append(1)
        mov_validos.append(temp)
    else: # Si va de derecha a izquierda suma.
      if estado_valido([estado[0]+i[0],estado[1]+i[1],1],prohibido) and i[0]+i[1]<=p:
        temp=list(i)
        temp.append(1)
        mov_validos.append(temp)
  return mov_validos

def principal(estado,prohibido): # Realiza el backtraking.
  global q, cambios, p, mov_anterior # Variables globales.
  prohibidos=prohibido.copy() # Hacemos copia de los anteriores prohibidos y agregamos el actual.
  prohibidos.append(estado)
  movimiento = movimientos(estado,p,prohibidos) # Calculamos los movimientos posibles de este estado, teniendo en cuenta los prohibidos.
  if mov_anterior in movimiento:
    movimiento.remove(mov_anterior) # Eliminamos de la lista el movimiento que se ejecutó anteriormente.
  for i in movimiento: # Recorremos todos los movimientos.
    if q: # Si ya se solucionó el programa sale de la función.
      return

    mov_anterior=i # Actualizamos el movimiento anterior.
    # Ejecutamos el movimiento.
    if estado[2]==1: # Resta si va a la derecha.
      resultado=[a-b for a,b in zip(estado,i)]
    else: # Suma si viene a la izquierda.
      resultado=[a+b for a,b in zip(estado,i)]
    cambios.append(i) # Lo agregamos a la variable que contiene todos los movimientos.
    if resultado[0]==0 and resultado[1]==0: # Verificamos si se encontró el estado objetivo.
      q = True
      return
    principal(resultado,prohibidos) # Llamamos la función con el resultado del movimiento y los prohibidos actuales.
    if not q: # Si al regresar de la función no ha encontrado la solución elimina los movimientos ejecutados.
      cambios.pop()

